import React from "react";
import { Route } from "react-router";
import { Grid } from "semantic-ui-react";
import allCampaings from "./allCampaings";
import campaings from "./campaings";

export default function KampanyalarDashboard() {
  return (
    <div>
      <Grid>
        <Grid.Row>
          <Grid.Column>
            <Grid.Column>
              <Route exact path="/kampanyalar" component={campaings} />
            </Grid.Column>
          </Grid.Column>
        </Grid.Row>
      </Grid>
    </div>
  );
}
